import React from 'react';
import '../Menu.css';

class scanBarcode extends React.Component{
  constructor(props)
  {
      super(props);
      this.state = {
          user: {}
      };
  }

  render(){
    
    const { user } = this.state;
    return (
      <div>
        <div className="Menu">
          <header className="Menu-header">
            <h1>Box Tracker</h1>
            <p>Welcome, {localStorage.getItem('username')}</p>
          </header>
            <div>
                Scanning Barcode:
            </div>
        </div>
      </div>
      );
    }
  }
  

export default scanBarcode;
